(14744, 'woocommerce_admin_notice_outdated_templates', '<strong>В вашей теме (WooVanilla) содержатся устаревшие копии некоторых шаблонов WooCommerce Wishlist плагина.</strong><br> Возможно, эти шаблоны потребуется обновить, чтобы обеспечить совместимость с текущей версией WooCommerce Wishlist плагина.<br> Эти шаблоны отображены на <a href=\"http://localhost/wp-admin/admin.php?page=wc-status\">странице состояния системы</a>.<br> Если увас есть сомнения, свяжитесь с автором темы.', 'yes'),
