(78, 'wc-admin-real-time-order-alerts', 'info', 'en_US', 'Получайте уведомления о новых заказах в реальном времени, где бы вы ни находились', 'Получайте уведомления об активности в магазине, в том числе о размещении новых заказов и отзывов о товарах, прямо на мобильные устройства благодаря приложению Woo.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-19 13:58:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(79, 'product_management_card_sorting', 'survey', 'en_US', 'How do you create and edit products?', 'Have a say in the future of WooCommerce. Take part in a brief exercise and help us understand what information is important to you while editing products.', '{}', 'pending', 'woocommerce.com', '2023-05-19 13:58:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(81, 'wc-admin-new-sales-record', 'info', 'en_US', 'Новый рекорд продаж!', 'Ого, 21.05.2023 был вашим рекордным днём по продажам! Чистая выручка 165 500 ₽ побил предыдущий рекорд 62 500 ₽ установленный 20.05.2023.', '{\"old_record_date\":\"2023-05-20\",\"old_record_amt\":62500,\"new_record_date\":\"2023-05-21\",\"new_record_amt\":165500}', 'unactioned', 'woocommerce-admin', '2023-05-22 16:46:58', NULL, 0, 'plain', '', 0, 0, 'info');
